import ExpenseItem from "./components/ExpenseItem";

function App() {
  let i = 0;
  const expenses = [
    {
      title: "WoW Subscription",
      amount: 12.99,
      date: new Date(2021, 4, 5),
    },
    {
      title: "WoW Subscription",
      amount: 12.99,
      date: new Date(2021, 4, 5),
    },
    {
      title: "WoW Subscription",
