      date: new Date(2021, 4, 5),
    },
    {
      title: "WoW Subscription",
      amount: 12.99,
      date: new Date(2021, 4, 5),
    },
  ];

  return (
    <div>
      <h1>Let's get started</h1>
      <ExpenseItem
        title={expenses[i++].title}
        amount={expenses[i++].amount}
        date={expenses[i++].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[i++].title}
        amount={expenses[i++].amount}
        date={expenses[i++].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[i++].title}
        amount={expenses[i++].amount}
        date={expenses[i++].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[i++].title}
        amount={expenses[i++].amount}
        date={expenses[i++].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
